import{_ as t,c as e,o as a,a2 as n}from"./chunks/framework.ClDkF6YQ.js";const x=JSON.parse('{"title":"目录结构","description":"","frontmatter":{},"headers":[],"relativePath":"articles/frontend/uni-app/uni-app简介.md","filePath":"articles/frontend/uni-app/uni-app简介.md"}'),l={name:"articles/frontend/uni-app/uni-app简介.md"},s=n(`<h1 id="目录结构" tabindex="-1">目录结构 <a class="header-anchor" href="#目录结构" aria-label="Permalink to &quot;目录结构&quot;">​</a></h1><p>一个uni-app工程，默认包含如下目录及文件：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>┌─uniCloud              云空间目录，阿里云为uniCloud-aliyun,腾讯云为uniCloud-tcb（详见uniCloud）</span></span>
<span class="line"><span>│─components            符合vue组件规范的uni-app组件目录</span></span>
<span class="line"><span>│  └─comp-a.vue         可复用的a组件</span></span>
<span class="line"><span>├─utssdk                存放uts文件</span></span>
<span class="line"><span>├─pages                 业务页面文件存放的目录</span></span>
<span class="line"><span>│  ├─index</span></span>
<span class="line"><span>│  │  └─index.vue       index页面</span></span>
<span class="line"><span>│  └─list</span></span>
<span class="line"><span>│     └─list.vue        list页面</span></span>
<span class="line"><span>├─static                存放应用引用的本地静态资源（如图片、视频等）的目录，注意：静态资源只能存放于此</span></span>
<span class="line"><span>├─uni_modules           存放[uni_module](/uni_modules)。</span></span>
<span class="line"><span>├─platforms             存放各平台专用页面的目录，详见</span></span>
<span class="line"><span>├─nativeplugins         App原生语言插件 详见</span></span>
<span class="line"><span>├─nativeResources       App端原生资源目录</span></span>
<span class="line"><span>│  └─android            Android原生资源目录 详见</span></span>
<span class="line"><span>├─hybrid                App端存放本地html文件的目录，详见</span></span>
<span class="line"><span>├─wxcomponents          存放小程序组件的目录，详见</span></span>
<span class="line"><span>├─unpackage             非工程代码，一般存放运行或发行的编译结果</span></span>
<span class="line"><span>├─AndroidManifest.xml   Android原生应用清单文件 详见</span></span>
<span class="line"><span>├─main.js               Vue初始化入口文件</span></span>
<span class="line"><span>├─App.vue               应用配置，用来配置App全局样式以及监听 应用生命周期</span></span>
<span class="line"><span>├─manifest.json         配置应用名称、appid、logo、版本等打包信息，详见</span></span>
<span class="line"><span>├─pages.json            配置页面路由、导航条、选项卡等页面类信息，详见</span></span>
<span class="line"><span>└─uni.scss              这里是uni-app内置的常用样式变量</span></span></code></pre></div><p><code>static目录</code> 使用注意</p><ul><li>编译到任意平台时，<code>static</code> 目录下除不满足<a href="https://uniapp.dcloud.net.cn/tutorial/platform.html#static-%E7%9B%AE%E5%BD%95%E7%9A%84%E6%9D%A1%E4%BB%B6%E7%BC%96%E8%AF%91" target="_blank" rel="noreferrer">条件编译</a>的文件，会直接复制到最终的打包目录，不会打包编译。非 <code>static</code> 目录下的文件（vue、js、css 等）只有被引用时，才会被打包编译。</li><li><code>css</code>、<code>less/scss</code> 等资源不要放在 <code>static</code> 目录下，建议这些公用的资源放在自建的 <code>common</code> 目录下。</li></ul><p><strong>Tips</strong></p><ul><li>HbuilderX 1.9.0+ 支持在根目录创建 <code>ext.json</code>、<code>sitemap.json</code> 等小程序需要的文件。</li></ul><h1 id="页面" tabindex="-1">页面 <a class="header-anchor" href="#页面" aria-label="Permalink to &quot;页面&quot;">​</a></h1><h2 id="页面简介" tabindex="-1">页面简介 <a class="header-anchor" href="#页面简介" aria-label="Permalink to &quot;页面简介&quot;">​</a></h2><p>uni-app项目中，一个页面就是一个符合<code>Vue SFC规范</code>的<code>.vue</code>文件或<code>.nvue</code>文件。</p><p><code>.vue</code>页面和<code>.nvue</code>页面，均全平台支持，差异在于当uni-app发行到App平台时，<code>.vue</code>文件会使用webview进行渲染，<code>.nvue</code>会使用原生进行渲染，</p><h2 id="新建页面" tabindex="-1">新建页面 <a class="header-anchor" href="#新建页面" aria-label="Permalink to &quot;新建页面&quot;">​</a></h2><p><code>uni-app</code>中的页面，通常会保存在工程根目录下的<code>pages</code>目录下。</p><p>每次新建页面，均需在<code>pages.json</code>中配置<code>pages</code>列表；未在<code>pages.json -&gt; pages</code> 中配置的页面，<code>uni-app</code>会在编译阶段进行忽略。pages.json的完整配置参考：<a href="https://uniapp.dcloud.net.cn/collocation/pages" target="_blank" rel="noreferrer">全局文件</a>。</p><h2 id="应用首页" tabindex="-1">应用首页 <a class="header-anchor" href="#应用首页" aria-label="Permalink to &quot;应用首页&quot;">​</a></h2><p><code>uni-app</code>会选择在<code>pages.json</code>中配置<code>pages</code>列表第一项作为首页。</p><h2 id="页面生命周期回调" tabindex="-1">页面生命周期回调 <a class="header-anchor" href="#页面生命周期回调" aria-label="Permalink to &quot;页面生命周期回调&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">函数名</th><th style="text-align:left;">说明</th><th style="text-align:left;">平台差异说明</th><th style="text-align:left;">最低版本</th></tr></thead><tbody><tr><td style="text-align:left;">onInit</td><td style="text-align:left;">监听页面初始化，其参数同 onLoad 参数，为上个页面传递的数据，参数类型为 Object（用于页面传参），触发时机早于 onLoad</td><td style="text-align:left;">百度小程序</td><td style="text-align:left;">3.1.0+</td></tr><tr><td style="text-align:left;">onLoad</td><td style="text-align:left;">监听页面加载，其参数为上个页面传递的数据，参数类型为 Object（用于页面传参），参考<a href="https://uniapp.dcloud.net.cn/api/router#navigateto" target="_blank" rel="noreferrer">示例</a></td><td style="text-align:left;"></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onShow</td><td style="text-align:left;">监听页面显示。页面每次出现在屏幕上都触发，包括从下级页面点返回露出当前页面</td><td style="text-align:left;"></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onReady</td><td style="text-align:left;">监听页面初次渲染完成。注意如果渲染速度快，会在页面进入动画完成前触发</td><td style="text-align:left;"></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onHide</td><td style="text-align:left;">监听页面隐藏</td><td style="text-align:left;"></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onUnload</td><td style="text-align:left;">监听页面卸载</td><td style="text-align:left;"></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onResize</td><td style="text-align:left;">监听窗口尺寸变化</td><td style="text-align:left;">App、微信小程序、快手小程序</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onPullDownRefresh</td><td style="text-align:left;">监听用户下拉动作，一般用于下拉刷新，参考<a href="https://uniapp.dcloud.net.cn/api/ui/pulldown" target="_blank" rel="noreferrer">示例</a></td><td style="text-align:left;"></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onReachBottom</td><td style="text-align:left;">页面滚动到底部的事件（不是scroll-view滚到底），常用于下拉下一页数据。具体见下方注意事项</td><td style="text-align:left;"></td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onTabItemTap</td><td style="text-align:left;">点击 tab 时触发，参数为Object，具体见下方注意事项</td><td style="text-align:left;">微信小程序、QQ小程序、支付宝小程序、百度小程序、H5、App、快手小程序、京东小程序</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onShareAppMessage</td><td style="text-align:left;">用户点击右上角分享</td><td style="text-align:left;">微信小程序、QQ小程序、支付宝小程序、字节小程序、飞书小程序、快手小程序、京东小程序</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onPageScroll</td><td style="text-align:left;">监听页面滚动，参数为Object</td><td style="text-align:left;">nvue暂不支持</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onNavigationBarButtonTap</td><td style="text-align:left;">监听原生标题栏按钮点击事件，参数为Object</td><td style="text-align:left;">App、H5</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onBackPress</td><td style="text-align:left;">监听页面返回，返回 event = {from:backbutton、 navigateBack} ，backbutton 表示来源是左上角返回按钮或 android 返回键；navigateBack表示来源是 uni.navigateBack ；详细说明及使用：<a href="http://ask.dcloud.net.cn/article/35120" target="_blank" rel="noreferrer">onBackPress 详解</a>。支付宝小程序只有真机能触发，只能监听非navigateBack引起的返回，不可阻止默认行为。</td><td style="text-align:left;">app、H5、支付宝小程序</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onNavigationBarSearchInputChanged</td><td style="text-align:left;">监听原生标题栏搜索输入框输入内容变化事件</td><td style="text-align:left;">App、H5</td><td style="text-align:left;">1.6.0</td></tr><tr><td style="text-align:left;">onNavigationBarSearchInputConfirmed</td><td style="text-align:left;">监听原生标题栏搜索输入框搜索事件，用户点击软键盘上的“搜索”按钮时触发。</td><td style="text-align:left;">App、H5</td><td style="text-align:left;">1.6.0</td></tr><tr><td style="text-align:left;">onNavigationBarSearchInputClicked</td><td style="text-align:left;">监听原生标题栏搜索输入框点击事件（pages.json 中的 searchInput 配置 disabled 为 true 时才会触发）</td><td style="text-align:left;">App、H5</td><td style="text-align:left;">1.6.0</td></tr><tr><td style="text-align:left;">onShareTimeline</td><td style="text-align:left;">监听用户点击右上角转发到朋友圈</td><td style="text-align:left;">微信小程序</td><td style="text-align:left;">2.8.1+</td></tr><tr><td style="text-align:left;">onAddToFavorites</td><td style="text-align:left;">监听用户点击右上角收藏</td><td style="text-align:left;">微信小程序、QQ小程序</td><td style="text-align:left;">2.8.1+</td></tr></tbody></table>`,18),d=[s];function i(p,o,r,c,g,f){return a(),e("div",null,d)}const y=t(l,[["render",i]]);export{x as __pageData,y as default};
